Sosialisasi diikuti Sekda Jembrana I Made Sudiada dan jajaran Forum Komunikasi Pimpinan Daerah (Forkopimda) Jembrana itu, ditandai pemasangan brosur di tempat-tempat strategis yang ada di sekitar pasar terbesar di Jembrana ini. Bupati Artha juga secara langsung memberikan peringatan dan imbauan bagi para pedagang termasuk para pembeli, agar tertib menjalankan protokol kesehatan (prokes) pencegahan Covid-19.
Di sela-sela sosialisasi, Bupati Artha mengatakan sosialisasi ini merupakan tindak lanjut dikeluarkannya Perbup Jembrana yang menyangkut pendisiplin prokes pencegahan Covid-19. Sosialisasi dilakukan, sebelum sanksi diterapkan mulai pekan depan. ‚ÄúDalam upaya pencegahan dan pengendalian Covid-19 dalam tatanan kehidupan era baru ini, sebelum memberikan sanksi, kita awali dulu dengan melakukan sosialisasi kepada masyarakat. Terutama warga yang sehari-harinya beraktivitas di pasar,‚Äù ujarnya.

