Sesuai dengan tujuannya untuk menggerakkan kembali para pelaku UMKM di kawasan Sanur, maka festival ini menggaet sebanyak 34 UMKM. ‚ÄúKita tonjolkan UMKM-UMKM yang seputaran Sanur,‚Äù ujar I Nengah Budiartawan selaku Ketua Panitia Fiesta Rujakan Sanur kepada NusaBali, kemarin. 

Sebanyak 34 UMKM yang mengikuti festival ini terdiri dari berbagai macam bentuk usaha, baik kuliner Bali, kuliner western, UMKM pertanian organik, dan lainnya. Hal ini, menurut Nengah Budiartawan, sesuai dengan konsep ‚Äòrujak‚Äô yang menjadi cikal bakal nama festival ini. Bahkan, dibukanya festival ini pun ditandai dengan pengulekan bumbu rujak dan dimeriahkan oleh tari kecak oleh panitia yang terlibat. 

