Kabid Labfor Polda Bali, Kombes Pol I Nyoman Sukena, mengatakan dari hasil pemeriksaan saintifik, pada ujung laras senjata api positif mengandung timbal atau GSR. ‚ÄúKemudian, swab pada pangkal laras senjata api juga mengandung GSR. Artinya, benar senjata ini yang ditembakkan saat kejadian. Selain itu, swab pada lubang tembak di baju korban dan hasilnya positif mengandung GSR," jelas Kombes Sukena saat rilis perkara di Mapolda Bali, Jalan WR Supratman 7 Denpasar, Jumat (4/9) siang
Menurut Kombes Sukena, barang bukti yang diperiksa secara saintifik dalam kasus bunuh diri Tri Nugraha, yang merupakan tersangka kasus dugaan gratifikasi dan TPPU, adalah senjata api jenis pistol merk revolver Nomor SR 38/357 T1102-14100095 SARSILMAZ buatan Turki, 4 butir peluru berukuran 38 mm yang ada di dalam pistol, 1 selongsong peluru, serta baju dan jam tangan yang digunakan saat kejadian.

