Pendaftaran Paket Bagus hanya melibatkan beberapa orang saja. Tidak ada pengerahan massa. Mereka berangkat dari kantor DPD II Golkar Bangli langsung menuju kantor KPU Bangli sekitar pukul 14.15 Wita. Di sela-sela pendaftaran Ketua DPD II Golkar Bangli, Gusti Made Winuntara, mengatakan Golkar dan NasDem resmi mengusung pasangan Made Subrata dan Ngakan Made Kutha Parwata. "Kami yakin meski dua partai, kami mampu memenangkan Pilkada Bangli," ungkapnya. 
Lanjutnya, pasangan calon yang diusung merupakan anak desa, maka dari itu pihaknya pun memiliki program membangun dari desa dan menata kota. "Kami harapkan dukungan penglingsir bagaimana membangkitkan kejayaan Golkar di tahun 1990-an. Begitu pula generasi muda yang ingin perubahan," tandasnya. 

