Penergasan ini disampaikan Cabup Nyoman Giri Prasta dalam deklarasi sebelum acara pendaftaran pasangan Giri Prasta-Suiasa ke KPU Badung, Jumat (4/9) pagi. Giri Prasta berharap kepada parpol mitra koalisi PDIP agar benar-benar berjuang memenangkan Giri-Asa (Giri Prasta-Suiasa) di Pilkada Badung, 9 Desember 2020 mendatang. Berjuang yang dimaksud Giri Prasta adalah memperjuangkan kesejahteraan masyarakat Badung.
‚ÄúKalau ada yang mengkampanyekan kertas kosong, itu artinya mereka tidak menginginkan pelestarian adat, sekolah gratis, dan kesehatan gratis. Giri-Asa ingin mengimplementasikan program-program dalam menjaga adat dan budaya. Ke depan, kita juga akan berikan santunan sampai pamangku paibon,‚Äù tegas Giri Prasta.
Giri Prasta pun mengajak Tim Pemenangan Giri-Asa dari unsur parpol koalisi (PDIP-Golkar-Demokrat-Hanura), yang disebut ‚ÄòSahabat Koalisi‚Äô, untuk melawan propaganda kotak kosong di masyarakat. ‚ÄúKalau ada mengarahkan memilih kertas kosong, kita lawan atau tidak?‚Äù tanya Giri Prasta. ‚ÄòLawan!‚Äù jawab Sahabat Koalisi serempak.

.

